            button22: {
                status: false,
                shape: "",
            },
            button23: {
                status: false,
                shape: "",
            },
            button31: {
                status: false,
                shape: "",
            },
            button32: {
                status: false,
                shape: "",
            },
            button33: {
                status: false,
                shape: "",
            },
        }

        this.play = this.play.bind(this);
        this.restart = this.restart.bind(this);
    };


    componentDidMount(){

    }

    componentWillUnmount(){

    }

    play(button){
        switch (button) {
            case "11": this.setState({
                status:true,
            })
